import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChartBar, faBox, faClipboardList, faUsers, faUserCircle, faAngleDown, faUserCog, faUserPlus } from '@fortawesome/free-solid-svg-icons';
import './Sidebar.css'; // Importing CSS file for styling

const Sidebar = ({ adminName }) => {
  const [title, setTitle] = React.useState('Admin Dashboard');
  const [showAdminMenu, setShowAdminMenu] = React.useState(false);
  const navigate = useNavigate(); // Use useNavigate hook

  const handleItemClick = (newTitle, route) => {
    setTitle(newTitle);
    navigate(`${route}?adminName=${encodeURIComponent(adminName)}`);
  };

  const toggleAdminMenu = () => {
    setShowAdminMenu(!showAdminMenu);
  };

  return (
    <div className="sidebar">
      <h2>{title}</h2>
      <div className="admin-name">{adminName}</div> {/* Display admin's name */}
      <ul>
        <li onClick={() => handleItemClick('Dashboard', '/dashboard')}>
          <span>
            <FontAwesomeIcon icon={faChartBar} />
            <span>Dashboard</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Products', '/products')}>
          <span>
            <FontAwesomeIcon icon={faBox} />
            <span>Products</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Orders', '/orders')}>
          <span>
            <FontAwesomeIcon icon={faClipboardList} />
            <span>Orders</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Farmers', '/farmer')}>
          <span>
            <FontAwesomeIcon icon={faUserCircle} />
            <span>Farmers</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Customers', '/customers')}>
          <span>
            <FontAwesomeIcon icon={faUsers} />
            <span>Customers</span>
          </span>
        </li>
        <li className="admin-dropdown" onClick={toggleAdminMenu}>
          <div>
            <FontAwesomeIcon icon={faUserCog} />
            <span>Admin Management</span>
            <FontAwesomeIcon icon={faAngleDown} className={showAdminMenu ? 'icon-rotate' : ''} />
          </div>
        </li>
        {showAdminMenu && (
          <li>
            <ul className="submenu">
              <li onClick={() => handleItemClick('Admins', '/admins')}>
                <span>
                  <FontAwesomeIcon icon={faUsers} />
                  <span>Admins</span>
                </span>
              </li>
              <li onClick={() => handleItemClick('Create', '/create')}>
                <span>
                  <FontAwesomeIcon icon={faUserPlus} />
                  <span>Create</span>
                </span>
              </li>
            </ul>
          </li>
        )}
      </ul>
    </div>
  );
};

export default Sidebar;
